export default (state = initialState, action) => {
    switch (action.type) {
        case ADD_DRAGON_BONES_RESOURCE: {
            const { dragonBonesList } = state;
            const { name, texture, textureJson, skeleton } = action;

            return {
                ...state,
                dragonBonesList: saveItemTo(dragonBonesList, {
                    id: uuid(),
                    name,
                    texture,
                    textureJson,
                    skeleton
                })
            };
        }
        case UPDATE_DRAGON_BONES_RESOURCE: {
            const { dragonBonesList } = state;
            const { id, name, texture, textureJson, skeleton } = action;

            return {
                ...state,
                dragonBonesList: saveItemTo(dragonBonesList, {
                    id,
                    name,
                    texture,
                    textureJson,
                    skeleton
                })
            };
        }
        case DELETE_DRAGON_BONES_RESOURCE: {
            const { dragonBonesList, pagination } = state;
            const { page, limit } = pagination;

            const result = removeItemById(dragonBonesList, action.id);
            const pageNumber = getAvailableCurrentPage(result, page, limit);

            return {
                ...state,
                dragonBonesList: result,
                pagination: {
                    ...pagination,
                    page: pageNumber
                }
            };
        }
        case CHANGE_DRAGON_BONES_VIEW: {
            return {
                ...state,
                view: action.view
            };
        }
        case CHANGE_DRAGON_BONES_PAGE: {
            return {
                ...state,
                pagination: {
                    ...state.pagination,
                    page: action.page
                }
            };
        }
        case CHANGE_DRAGON_BONES_LIMIT: {
            return {
                ...state,
                pagination: {
                    ...state.pagination,
                    page: 0,
                    limit: action.limit
                }
            };
        }
        case CHANGE_DRAGON_BONES_SORT: {
            return {
                ...state,
                sorting: {
                    ...state.sorting,
                    field: action.field,
                    direction: (state.sorting.direction === "asc") ? "desc" : "asc"
                }
            };
        }
        case CHANGE_DRAGON_BONES_FILTER_VALUE: {
            const { filterKey, filterValue } = action;

            if (filterValue !== null) {
                return {
                    ...state,
                    filters: {
                        ...state.filters,
                        [filterKey]: filterValue
                    }
                };
            }
            return state;
        }
        default:
            return state;
    }
}
